/*Table structure for table `mst_mas_loc` */

DROP TABLE IF EXISTS `mst_mas_loc`;

CREATE TABLE `mst_mas_loc` (
  `MAS_LOC` varchar(8) NOT NULL COMMENT '仓库编码',
  `LSP` varchar(10) DEFAULT NULL COMMENT '承运商编码',
  `DESCR` varchar(50) DEFAULT NULL COMMENT '描述',
  `INSERT_DATE` datetime DEFAULT NULL COMMENT '录入日期',
  `INSERT_BY` varchar(50) DEFAULT NULL COMMENT '录入者',
  `MODIFIED_DATE` datetime DEFAULT NULL COMMENT '更新日期',
  `MODIFIED_BY` varchar(50) DEFAULT NULL COMMENT '更新者',
  `ENABLED` int(1) DEFAULT '1' COMMENT '可用值',
  `CENTRAL_LOCATION` varchar(10) DEFAULT NULL COMMENT '中心坐标',
  `HUB_TYPE` varchar(15) DEFAULT NULL COMMENT '主库类型VMI; PMR; SC',
  `CCN_CODE` varchar(6) DEFAULT NULL COMMENT '配船编码',
  `AREA_CODE` varchar(10) DEFAULT NULL COMMENT '区域编码',
  `TIMEZONE` varchar(10) DEFAULT NULL COMMENT '时区',
  `BUCKET_TYPE` varchar(20) DEFAULT NULL COMMENT '库区类型',
  `COUNTRY_CODE` varchar(3) DEFAULT NULL COMMENT '国家代码',
  `PARENT_MAS_LOC` varchar(8) DEFAULT NULL COMMENT '父节点仓库编码to support multilayer SC',
  `CONTACT_NAME` varchar(50) DEFAULT NULL COMMENT '联系人名称',
  `CONTACT_PHONE` varchar(30) DEFAULT NULL COMMENT '联系人电话',
  `ADDRESS` varchar(250) DEFAULT NULL COMMENT '地址',
  `ZIP_CODE` varchar(7) DEFAULT NULL COMMENT '邮编',
  `MANAGEABLE_TYPE` varchar(1) DEFAULT NULL COMMENT '可控类型',
  `MANAGEABLE_FLAG` varchar(60) DEFAULT NULL COMMENT '可控标识',
  `SEND_HUB_TYPE` varchar(60) DEFAULT NULL COMMENT '发送类型',
  `CITY` varchar(50) DEFAULT NULL COMMENT '城市',
  PRIMARY KEY (`MAS_LOC`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓库信息';

/*Data for the table `mst_mas_loc` */

