/*Table structure for table `security_user_base_federated` */

DROP TABLE IF EXISTS `security_user_base_federated`;

CREATE TABLE `security_user_base_federated` (
  `login_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '登录主键',
  `real_name` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '真实姓名',
  `sex` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '性别，0女，1男',
  `post` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '职位',
  `tel` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '固话',
  `mobile` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '手机',
  `email` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '邮箱',
  `employee_code` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '员工编号',
  `check_no` varchar(11) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '考勤编号',
  `ID_number` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '身份证号',
  `hiredate` timestamp NULL DEFAULT NULL COMMENT '入职时间',
  `leave_date` datetime DEFAULT NULL COMMENT '离职日期',
  `superior_id` int(11) DEFAULT NULL COMMENT '绩效审核人id',
  `superior_name` varchar(255) DEFAULT NULL COMMENT '绩效审核人姓名',
  `hight_id` int(10) unsigned DEFAULT NULL COMMENT '上级id',
  `hight_name` varchar(255) DEFAULT NULL COMMENT '上级姓名',
  `isLookPayment` int(10) unsigned DEFAULT NULL COMMENT '是否可以查看下属薪酬 1：可以查看',
  `user_accout` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '代发账户',
  `user_type` int(10) unsigned DEFAULT NULL COMMENT '前中后台 1:前台2:中台3:后台',
  `user_company` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '公司',
  `is_official` int(10) unsigned DEFAULT NULL COMMENT '是否转正:1:是转正，0没转正',
  `ID_number_omit` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '身份证号的省略',
  `insert_by` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '创建人',
  `insert_date` datetime NOT NULL COMMENT '创建时间',
  `modified_by` text CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '更新人',
  `modified_date` datetime NOT NULL COMMENT '更新时间',
  `place` bigint(20) DEFAULT NULL COMMENT '管理归属:1:销售一部,2:销售二部,3:北京总部,4:天津途乐',
  `user_area` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '所属区域',
  PRIMARY KEY (`login_id`)
) ENGINE=FEDERATED DEFAULT CHARSET=utf8 COMMENT='用户基本信息表' CONNECTION='mysql://wh_uat:wh_uat@192.168.99.28:3306/mdm_uat/security_user_base';

/*Table structure for table `security_user_federated` */

DROP TABLE IF EXISTS `security_user_federated`;

CREATE TABLE `security_user_federated` (
  `su_id` int(11) NOT NULL COMMENT 'ID号',
  `site_code` varchar(32) DEFAULT NULL COMMENT '站点code',
  `su_account` varchar(50) DEFAULT NULL COMMENT '账户',
  `su_name` varchar(50) DEFAULT NULL COMMENT '名称',
  `identification` varchar(20) DEFAULT NULL COMMENT '身份证',
  `su_email` varchar(50) DEFAULT NULL COMMENT 'E-mail',
  `su_extension` varchar(30) DEFAULT NULL COMMENT '电话分机',
  `su_segment` varchar(50) DEFAULT NULL,
  `su_active` varchar(1) DEFAULT 'Y' COMMENT '失效标识，Y为有效，N为失效',
  `su_admin_flag` varchar(1) DEFAULT 'N' COMMENT '是否为管理员',
  `su_remark` varchar(100) DEFAULT NULL COMMENT '备注',
  `su_password` varchar(50) DEFAULT NULL COMMENT '密码',
  `su_lsp_code` varchar(10) DEFAULT NULL COMMENT 'lsp代码',
  `su_domain` varchar(20) DEFAULT NULL COMMENT '域',
  `su_roles` varchar(200) DEFAULT NULL COMMENT '角色',
  `su_title` varchar(50) DEFAULT NULL COMMENT '标题',
  `su_is_employee` varchar(1) DEFAULT 'Y' COMMENT '是否为企业员工',
  `su_manager_email` varchar(50) DEFAULT NULL COMMENT '管理员Email',
  `su_enabled` int(11) DEFAULT '1' COMMENT '是否激活',
  `insert_by` varchar(50) DEFAULT NULL COMMENT '插入人',
  `insert_date` datetime DEFAULT NULL COMMENT '插入时间',
  `modified_by` varchar(50) DEFAULT NULL COMMENT '更新人',
  `modified_date` datetime DEFAULT NULL COMMENT '更新时间',
  `su_timezone` varchar(100) DEFAULT NULL COMMENT '时区',
  `su_language` varchar(32) DEFAULT NULL COMMENT '语言',
  `su_default_buid` int(11) DEFAULT NULL COMMENT '默认buid',
  `su_country_code` varchar(3) DEFAULT NULL COMMENT '国家编码',
  `su_default_area_code` varchar(10) DEFAULT NULL COMMENT '区域编码',
  `last_login_date` datetime DEFAULT NULL COMMENT '最后登录时间',
  `has_changed_pswd` varchar(1) DEFAULT 'N',
  `invalid_attampts` int(11) DEFAULT '0',
  `lockout_time` datetime DEFAULT NULL COMMENT '锁定时间',
  `mas_loc` varchar(100) DEFAULT NULL COMMENT '仓库',
  `rf_login_count` int(11) DEFAULT '0' COMMENT '登录次数统计',
  `login_status` varchar(4) DEFAULT 'N' COMMENT '登录状态',
  `telephone_num` varchar(32) DEFAULT NULL COMMENT '电话号码',
  `sex` bit(1) DEFAULT NULL COMMENT '性别',
  `effect_date` datetime DEFAULT NULL COMMENT '作用时间',
  `expire_date` datetime DEFAULT NULL COMMENT '终止时间',
  `employee_no` varchar(10) DEFAULT NULL,
  `weixin_no` varchar(50) DEFAULT NULL COMMENT '微信号',
  `user_base_id` bigint(20) DEFAULT NULL COMMENT '员工信息ID',
  PRIMARY KEY (`su_id`)
) ENGINE=FEDERATED DEFAULT CHARSET=utf8 CONNECTION='mysql://wh_uat:wh_uat@192.168.99.28:3306/mdm_uat/security_user';

/*Table structure for table `security_user_org` */

DROP TABLE IF EXISTS `security_user_org`;

CREATE TABLE `security_user_org` (
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `org_id` varchar(32) NOT NULL COMMENT '机构ID',
