/*Table structure for table `t_mst_bank_federated` */

DROP TABLE IF EXISTS `t_mst_bank_federated`;

CREATE TABLE `t_mst_bank_federated` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `cost_center_id` int(10) unsigned DEFAULT NULL COMMENT '成本中心ID',
  `type` int(2) unsigned DEFAULT NULL COMMENT '账户类型;1:个人，2：对公',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '银行',
  `branch_name` varchar(50) DEFAULT NULL COMMENT '分支行',
  `payee` varchar(50) DEFAULT NULL COMMENT '收款人/单位',
  `bank_account` varchar(50) DEFAULT NULL COMMENT '银行账号',
  `province` bigint(20) DEFAULT NULL COMMENT '所属省',
  `city` bigint(20) DEFAULT NULL COMMENT '所属市',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(50) DEFAULT NULL COMMENT '更新人',
  `bank_id` bigint(20) DEFAULT NULL,
  `data_code` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '数据字典码表编码',
  PRIMARY KEY (`id`)
) ENGINE=FEDERATED DEFAULT CHARSET=utf8 COMMENT='银行账户表' CONNECTION='mysql://wh_uat:wh_uat@192.168.99.28:3306/mdm_uat/t_mst_bank';

/*Table structure for table `t_mst_car_brand` */

DROP TABLE IF EXISTS `t_mst_car_brand`;

CREATE TABLE `t_mst_car_brand` (
  `id` int(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `code` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '品牌编码',
  `name` varchar(50) DEFAULT NULL COMMENT '品牌名称',
  `factory_code` varchar(50) DEFAULT NULL COMMENT '厂商编码，关联码表',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(50) DEFAULT NULL COMMENT '更新人',
  `is_del` tinyint(1) unsigned DEFAULT '1' COMMENT '是否删除 0:删除状态不可用。1:可用状态',
  `initial` tinytext CHARACTER SET utf8 COLLATE utf8_bin COMMENT '首字母，排序用',
  `creator_id` int(20) unsigned DEFAULT NULL COMMENT '创建人ID',
  `updator_id` int(20) unsigned DEFAULT NULL COMMENT '修改人ID',
  PRIMARY KEY (`id`),
  KEY `t_mst_car_brand_brand_code` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8 COMMENT='主数据车辆品牌表';

