/*Table structure for table `t_mst_car_model_color` */

DROP TABLE IF EXISTS `t_mst_car_model_color`;

CREATE TABLE `t_mst_car_model_color` (
  `color_id` int(20) unsigned NOT NULL COMMENT '颜色ID，存放数据字典表ID',
  `model_id` int(20) unsigned NOT NULL COMMENT '车型ID，存放车型库表ID',
  PRIMARY KEY (`color_id`,`model_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='主数据模型颜色中间表';

