/*Table structure for table `t_mst_car_model_federated` */

DROP TABLE IF EXISTS `t_mst_car_model_federated`;

CREATE TABLE `t_mst_car_model_federated` (
  `id` int(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `series_id` int(20) unsigned DEFAULT NULL COMMENT '系列id',
  `code` varchar(50) DEFAULT NULL COMMENT '型号编码',
  `is_del` tinyint(1) unsigned DEFAULT '1' COMMENT '是否删除 0:删除状态不可用。1:可用状态',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) DEFAULT NULL COMMENT '更新人',
  `style` varchar(50) DEFAULT NULL COMMENT '款式',
  `engine_displacement` varchar(50) DEFAULT NULL COMMENT '排量',
  `seating` varchar(50) DEFAULT NULL COMMENT '座位数',
  `gear_box` varchar(50) DEFAULT NULL COMMENT '变速箱',
  `auto_type` varchar(50) DEFAULT NULL COMMENT '车型',
  `creator_id` int(20) unsigned DEFAULT NULL COMMENT '创建人ID',
  `updator_id` int(20) unsigned DEFAULT NULL COMMENT '修改人ID',
  `guide_price` bigint(20) DEFAULT NULL COMMENT '指导价',
  `system_type` varchar(50) DEFAULT NULL COMMENT '品牌型号',
  PRIMARY KEY (`id`),
  KEY `t_mst_car_model_ix1` (`code`)
) ENGINE=FEDERATED DEFAULT CHARSET=utf8 COMMENT='主数据车型库表' CONNECTION='mysql://wh_uat:wh_uat@192.168.99.28:3306/mdm_uat/t_mst_car_model';

