/*Table structure for table `t_mst_organization` */

DROP TABLE IF EXISTS `t_mst_organization`;

CREATE TABLE `t_mst_organization` (
  `id` bigint(20) unsigned NOT NULL COMMENT '主键id',
  `parent_id` int(20) unsigned DEFAULT NULL COMMENT '父主键parent_id',
  `code` varchar(50) DEFAULT NULL COMMENT '机构编码',
  `name` varchar(50) DEFAULT NULL COMMENT '机构名称',
  `alias` varchar(50) DEFAULT NULL COMMENT '机构别名',
  `province` int(20) unsigned DEFAULT NULL COMMENT '省份编码',
  `city` int(20) unsigned DEFAULT NULL COMMENT '城市编码',
  `county` int(20) unsigned DEFAULT NULL COMMENT '区县编码',
  `detail_address` varchar(50) DEFAULT NULL COMMENT '详细地址',
  `status` varchar(50) DEFAULT NULL COMMENT '0为不可用;1为可用',
  `level` varchar(50) DEFAULT NULL COMMENT '机构级别：1：总部；2：一级部门；3：二级部门；4：分公司；5：门店。',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `create_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `update_user` varchar(50) DEFAULT NULL COMMENT '更新人',
  `area` varchar(50) DEFAULT NULL COMMENT '所属大区，数据参考码表',
  `organ_no` varchar(50) DEFAULT NULL COMMENT '机构编号',
  `tel_no` varchar(50) DEFAULT NULL COMMENT '固定电话',
  `regist_name` varchar(50) DEFAULT NULL COMMENT '注册名',
  `regist_date` timestamp NULL DEFAULT NULL COMMENT '注册日期',
  `is_thirdparty` int(2) unsigned DEFAULT NULL COMMENT '机构类型 1：部分；2：分部；3：分公司；4：门店；5：中心库；6：第三方',
  `is_head_safing` int(10) unsigned DEFAULT NULL COMMENT '是否总部上保险',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `t_mst_organization_ix1` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='组织机构编码表';

