/*Table structure for table `t_mst_organization_federated` */

DROP TABLE IF EXISTS `t_mst_organization_federated`;

CREATE TABLE `t_mst_organization_federated` (
  `id` bigint(20) unsigned DEFAULT NULL COMMENT '主键id',
  `parent_id` int(20) unsigned DEFAULT NULL COMMENT '父主键parent_id',
  `code` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '机构编码',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '机构名称',
