/*Table structure for table `t_mst_storage_info_federated` */

DROP TABLE IF EXISTS `t_mst_storage_info_federated`;

CREATE TABLE `t_mst_storage_info_federated` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `code` varchar(50) DEFAULT NULL COMMENT '仓库编码',
  `name` varchar(50) DEFAULT NULL COMMENT '仓库名称',
  `province_code` int(10) unsigned DEFAULT NULL COMMENT '省份',
  `city_code` int(10) unsigned DEFAULT NULL COMMENT '区、市',
  `address` varchar(50) DEFAULT NULL COMMENT '地址',
  `contact` varchar(50) DEFAULT NULL COMMENT '库管员',
  `phone` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `acreage` decimal(10,6) DEFAULT NULL COMMENT '面积',
  `deadline_start` timestamp NULL DEFAULT NULL COMMENT '租赁开始时间',
  `deadline_end` timestamp NULL DEFAULT NULL COMMENT '租赁结束时间',
  `insert_date` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `modified_date` timestamp NULL DEFAULT NULL COMMENT '最后更新时间',
  `insert_by` varchar(50) DEFAULT NULL COMMENT '创建人',
  `modified_by` varchar(50) DEFAULT NULL COMMENT '更新人',
  `insert_by_Id` int(10) unsigned DEFAULT NULL COMMENT '创建用户ID',
  `modified_by_Id` int(10) unsigned DEFAULT NULL COMMENT '更新用户ID',
  `supervise` int(10) unsigned DEFAULT NULL COMMENT '是否监管；0：否，1：是',
  `type` int(10) unsigned DEFAULT NULL COMMENT '仓库类型 1：中心库，2：门店库',
  `enabled` int(10) unsigned DEFAULT NULL COMMENT '是否启用 0：否，1：是',
  `organ_code` varchar(20) DEFAULT NULL COMMENT '机构ID',
  `county_code` int(10) DEFAULT NULL COMMENT '区县编码',
  PRIMARY KEY (`id`),
  KEY `t_mst_storage_info_ix1` (`code`)
) ENGINE=FEDERATED DEFAULT CHARSET=utf8 COMMENT='仓库信息表' CONNECTION='mysql://wh_uat:wh_uat@192.168.99.28:3306/mdm_uat/t_mst_storage_info';

/*!50106 set global event_scheduler = 1*/;

/* Event structure for event `call_Stored_Procedures` */

/*!50106 DROP EVENT IF EXISTS `call_Stored_Procedures`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`%` EVENT `call_Stored_Procedures` ON SCHEDULE EVERY 5 SECOND STARTS '2017-02-14 16:14:35' ON COMPLETION NOT PRESERVE ENABLE DO call sync_mst_all() */$$
DELIMITER ;

