/* Procedure structure for procedure `sync_mst_bank` */

/*!50003 DROP PROCEDURE IF EXISTS  `sync_mst_bank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sync_mst_bank`()
BEGIN
DECLARE id	int(10)                ;
DECLARE cost_center_id	int(10)    ;
DECLARE type	int(2)             ;
DECLARE bank_name	varchar(50)    ;
DECLARE branch_name	varchar(50)    ;
DECLARE payee	varchar(50)        ;
DECLARE bank_account	varchar(50);
DECLARE province	bigint(20)     ;
DECLARE city	bigint(20)         ;
DECLARE create_time	timestamp      ;
DECLARE update_time	timestamp      ;
DECLARE create_user	varchar(50)    ;
DECLARE update_user	varchar(50)    ;
DECLARE bank_id	bigint(20)         ;
DECLARE data_code	tinytext       ;
DECLARE is_create tinyint(1);
DECLARE
    COUNT INT;
DECLARE
    index_ INT;
DECLARE
    _Cur
    CURSOR FOR
        SELECT
            b.*,case when a.id is not null then 0 else 1 end is_create
        FROM
            t_mst_bank_federated b
				left join t_mst_bank a ON a.id=b.id
        WHERE
            NOT EXISTS
            (
                SELECT
                    1
                FROM
                    t_mst_bank t
                WHERE
                    t.id=b.id
                AND t.update_time=b.update_time);
SET index_ = 0;
SELECT
    COUNT(1)
INTO
    COUNT
FROM
            t_mst_bank_federated b
        WHERE
            NOT EXISTS
            (
                SELECT
                    1
                FROM
                    t_mst_bank t
                WHERE
                    t.id=b.id
                AND t.update_time=b.update_time);
IF COUNT>0 THEN
OPEN _Cur;
REPEAT
FETCH
    _Cur
INTO
  id,cost_center_id,type,bank_name,branch_name,payee,bank_account,province,city,create_time,update_time,create_user,update_user,bank_id,data_code,is_create;
IF is_create=1 THEN
    INSERT
    INTO
        t_mst_bank VALUES
        (
			id,cost_center_id,type,bank_name,branch_name,payee,bank_account,province,city,create_time,update_time,create_user,update_user,bank_id,data_code
        );
ELSE
   UPDATE
        t_mst_bank
    SET
t_mst_bank.cost_center_id=cost_center_id,
t_mst_bank.type          =type          ,
t_mst_bank.bank_name     =bank_name     ,
t_mst_bank.branch_name   =branch_name   ,
t_mst_bank.payee         =payee         ,
t_mst_bank.bank_account  =bank_account  ,
t_mst_bank.province      =province      ,
t_mst_bank.city          =city          ,
t_mst_bank.create_time   =create_time   ,
t_mst_bank.update_time   =update_time   ,
t_mst_bank.create_user   =create_user   ,
t_mst_bank.update_user   =update_user   ,
t_mst_bank.bank_id       =bank_id       ,
t_mst_bank.data_code     =data_code      
where t_mst_bank.id         =id;
END IF;
SET index_ = index_+1;
UNTIL index_ = COUNT
END REPEAT;
CLOSE _Cur;
END IF;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sync_mst_car_brand` */

/*!50003 DROP PROCEDURE IF EXISTS  `sync_mst_car_brand` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sync_mst_car_brand`()
BEGIN
    DECLARE
        id INT(20) ;
DECLARE
    code VARCHAR(50) ;
DECLARE
    name VARCHAR(50) ;
DECLARE
    factory_code VARCHAR(50) ;
DECLARE
    create_time TIMESTAMP ;
DECLARE
    update_time TIMESTAMP ;
DECLARE
    create_user VARCHAR(50) ;
DECLARE
    update_user VARCHAR(50) ;
DECLARE
    is_del TINYINT(1) ;
DECLARE
    INITIAL tinytext ;
DECLARE
    creator_id INT(20);
DECLARE
    updator_id INT(20);
DECLARE
    COUNT INT;
DECLARE
    index_ INT;
DECLARE is_create tinyint(1);

DECLARE
    _Cur
    CURSOR FOR
        SELECT
             b.*,case when a.id is not null then 0 else 1 end is_create
