/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sync_mst_car_model`()
BEGIN
DECLARE id	int(20)                    ;
DECLARE series_id	int(20)            ;
DECLARE code	varchar(50)                ;
DECLARE is_del	tinyint(1)             ;
