DECLARE engine_displacement	varchar(50);
DECLARE seating	varchar(50)            ;
DECLARE gear_box	varchar(50)            ;
DECLARE auto_type	varchar(50)        ;
DECLARE creator_id	int(20)            ;
DECLARE updator_id	int(20)            ;
DECLARE guide_price	bigint(20)         ;
DECLARE system_type	varchar(50)        ;
DECLARE is_create tinyint(1);
DECLARE
    COUNT INT;
DECLARE
    index_ INT;
DECLARE
    _Cur
    CURSOR FOR
        SELECT
    a.id,
    a.series_id,
    a.code,
    a.is_del,
    a.create_time,
    a.create_user,
    a.update_time,
    a.update_user,
    a.style,
    a.engine_displacement,
    a.seating,
    a.gear_box,
    concat( e.name, ' ', d.name, ' ', b.name, ' ', a.auto_type, ' ', c.name ) AS auto_type,
    a.creator_id,
    a.updator_id,
    a.guide_price,
    a.system_type,
		case when m.id is not null then 0 else 1 end is_create
FROM
    t_mst_car_model_federated a
left join t_mst_car_model m on a.id=m.id

LEFT JOIN
    t_mst_data_dictionary b
ON
    b.type = 'gear_box'
AND a.gear_box = b.value
LEFT JOIN
    t_mst_data_dictionary c
ON
    c.type = 'seat_code'
AND a.seating = c.value
LEFT JOIN
    t_mst_data_dictionary d
ON
    d.type = 'engine_displacement'
AND a.engine_displacement = d.value
LEFT JOIN
    t_mst_data_dictionary e
ON
    e.type = 'style_code'
AND a.style = e.value
WHERE
    NOT EXISTS
    (
        SELECT
            1
        FROM
            t_mst_car_model t
        WHERE
            t.id=b.id
        AND t.update_time=b.update_time);
SET index_ = 0;
SELECT
    COUNT(1)
INTO
    COUNT
FROM
            t_mst_car_model_federated b
        WHERE
            NOT EXISTS
            (
                SELECT
                    1
                FROM
                    t_mst_car_model t
                WHERE
                    t.id=b.id
                AND t.update_time=b.update_time);
IF COUNT>0 THEN
OPEN _Cur;
REPEAT
FETCH
    _Cur
INTO
  id,series_id,code,is_del,create_time,create_user,update_time,update_user,style,engine_displacement,seating,gear_box,auto_type,creator_id,updator_id,guide_price,system_type,is_create;
IF is_create=1 THEN
    INSERT
    INTO
        t_mst_car_model VALUES
        (
			id,series_id,code,is_del,create_time,create_user,update_time,update_user,style,engine_displacement,seating,gear_box,auto_type,creator_id,updator_id,guide_price,system_type
        );
ELSE
   UPDATE
        t_mst_car_model
    SET
t_mst_car_model.id                 =id                 ,
t_mst_car_model.series_id          =series_id          ,
t_mst_car_model.code               =code               ,
t_mst_car_model.is_del             =is_del             ,
t_mst_car_model.create_time        =create_time        ,
t_mst_car_model.create_user        =create_user        ,
t_mst_car_model.update_time        =update_time        ,
t_mst_car_model.update_user        =update_user        ,
t_mst_car_model.style              =style              ,
t_mst_car_model.engine_displacement=engine_displacement,
t_mst_car_model.seating            =seating            ,
t_mst_car_model.gear_box           =gear_box           ,
t_mst_car_model.auto_type          =auto_type          ,
t_mst_car_model.creator_id         =creator_id         ,
t_mst_car_model.updator_id         =updator_id         ,
t_mst_car_model.guide_price        =guide_price        ,
t_mst_car_model.system_type        =system_type        
where t_mst_car_model.id         =id;
END IF;
SET index_ = index_+1;
UNTIL index_ = COUNT
END REPEAT;
CLOSE _Cur;
END IF;
END */$$
DELIMITER ;

